  width: 100%;

    margin-right: 12px;

}

.accordion__panel {

enario: Validate Check our drug list link\r\n    And I click Shop for a plan tab\r\n    When I hover over Medicare tab\r\n    Then I see drug list Link\r\n\r\n  @test\r\n  Scenario: Verify Check our drug list page title\r\n    And I click Shop for a plan tab\r\n    And I hover over Medicare tab\r\n    When I click Check our drug list Link\r\n    Then I see the page title as \"Check Our Medicare Covered Drug List | Aetna Medicare\"\r\n\r\n  @test\r\n  Scenario: Verify Check our drug list page url\r\n    And I click Shop for a plan tab\r\n    And I hover over Medicare tab\r\n    When I click Check our drug list Link\r\n    Then I see the page url as \"https://www.aetnamedicare.com/en/prescription-drugs/check-medicare-drug-list.html\"\r\n\r\n  @test\r\n  Scenario: Validate Health coverage list link\r\n    And I click Shop for a plan tab\r\n    When I hover over Health coverage tab\r\n    Then I see Health coverage Link\r\n\r\n  @test\r\n  Scenario: Validate Plans through an employer link\r\n    And I click Shop for a plan tab\r\n    When I hover over Health coverage tab\r\n    Then I see Plans through an employer Link\r\n#\r\n  @test\r\n  Scenario: Verify Plans through an employer page title\r\n    And I click Shop for a plan tab\r\n    And I hover over Health coverage tab\r\n    When I click Plans through an employer Link\r\n    Then I see the page title as \"Health Insurance Through Work | Employee Health Insurance Plans | Aetna\"\r\n\r\n  @test\r\n  Scenario: Verify Plans through an employer page url\r\n    And I click Shop for a plan tab\r\n    And I hover over Health coverage tab\r\n    When I click Plans through an employer Link\r\n    Then I see the page url as \"https://www.aetna.com/individuals-families/health-insurance-through-work.html\"\r\n\r\n  @test\r\n  Scenario: Validate Student plans link\r\n    And I click Shop for a plan tab\r\n    When I hover over Health coverage tab\r\n    Then I see Student plans link\r\n#\r\n  @test\r\n  Scenario: Verify Student plans page title\r\n    And I click Shop for a plan tab\r\n    And I hover over Health coverage tab\r\n    When I click Student plans link\r\n    Then I see the page title as \"Home | Aetna Student Health\"\r\n\r\n  @test\r\n  Scenario: Verify Student plans page url\r\n    And I click Shop for a plan tab\r\n    And I hover over Health coverage tab\r\n    When I click Student plans link\r\n    Then I see the page url as \"https://www.aetnastudenthealth.com/en/index.html\"\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Fiz/IdeaProjects/BDDAutomationFramework_Team2/Aetna/src/test/java/features/ShopForPlan.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Shop for a plan function","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"I am on the Individual Plans Page","id":"0461b2d5-f52e-4d75-a696-8dabf00757a2"}],"id":"a3416e9e-e301-4e21-a897-2c15815c3dec"}},{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":6,"column":3},"name":"@test","id":"bb0bf59a-dfa7-473b-abf5-b5b93ee2237e"}],"keyword":"Scenario","name":"Shop for a plan drop down menu function","steps":[{"location":{"line":8,"column":5},"keyword":"And ","text":"I click Shop for a plan tab","id":"6d619313-742e-4bdb-87a4-29a7c09ca11d"},{"location":{"line":9,"column":5},"keyword":"When ","text":"I hover over Medicare tab","id":"065f4e1b-dbf7-47d9-b0d9-4e33c01a2847"},{"location":{"line":10,"column":5},"keyword":"Then ","text":"I see Browse Plans Link","id":"e0e744ad-28e2-4bf8-b0bb-884350b351a5"}],"id":"8da4c92f-8321-4600-b12d-eea12efd9bc9"}},{"scenario":{"location":{"line":13,"column":3},"tags":[{"location":{"line":12,"column":3},"name":"@test","id":"017b402a-456d-4cd2-803e-10a5e474b5bd"}],"keyword":"Scenario","name":"Validate Browse Plans link","steps":[{"location":{"line":14
